import React from 'react';
import Cart from './Cart'
import ItemList from "./ItemList/ItemList";
import 'bootstrap/dist/css/bootstrap.css'

function App() {
    const items = [
        {id: 1, title: 'Товар 1', cost: 13930},
        {id: 2,title: 'Товар 2', cost: 25570},
        {id: 3,title: 'Товар 3', cost: 15090},
        {id: 4,title: 'Товар 4', cost: 17370}
        ];


    return (
        <div className="container">
            <ItemList items={items}/>
        </div>
    );
}

export default App;
